CREATE FUNCTION qset.get_py_slip_amount(v_pfno character varying, v_itemcode character varying, v_pyear bigint, v_pmonth bigint) RETURNS numeric
    LANGUAGE plpgsql
    AS $$
	DECLARE 
		v_amount NUMERIC;  		
	BEGIN

		SELECT 
			amount INTO v_amount 
		FROM 
			qset.pyslip 
		WHERE 
			pfno 		= v_pfno AND 
			itemcode 	= v_itemcode AND  
			pyear 		= v_pyear AND 
			pmonth 		= v_pmonth;

		v_amount := COALESCE(v_amount, 0.00) ;
		
	RETURN v_amount;
END;
$$;


